/**
 * @api {GET} /news Listar
 *
 * @apiName Listar
 * @apiGroup News
 * @apiDescription listar registros.
 * @apiPermission admin
 *
 * @apiHeader {String} x-access-token Token de acesso obitido no login.
 *
 * @apiParam {String} [search] Uma ou mais palavras a serem buscadas. Quando este parâmetro for informado
 * apenas registros contendo ao menos uma das palavras buscadas serão retornados
 * @apiParam {Number} [page] Indice da página.
 * @apiParam {Number} [limit] Quantidade por página.
 * @apiParam {string="title","createdAt"} [orderBy=createdAt] Campo do documento pelo qual os registros devem ser ordenados.
 * @apiParam {string="asc","desc"} [orderDirection=desc] Sentido da ordenação. Ascendente ou descendente.
 *
 * @apiParamExample {String} Request-URL-Example:
 *   /news?search=pesquisar&page=1&limit=2&orderBy=title&orderDirection=asc
 *
 * @apiSuccessExample {json} Success-Reponse:
 *   HTTP/1.1 200 OK
 *   {
 *     "docs": [
 *       {
 *         "_id": "56925f1b621d201be828880e",
 *         "slug": "titulo-da-noticia",
 *         "title": "Título da notícia",
 *         "shortDescription": "Breve descrição da Notícia",
 *         "description": "Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been...",
 *         "createdAt": "2016-01-10T22:11:54.157Z",
 *         "updatedAt": "2016-01-11T21:55:50.100Z",
 *         "keyWords": "palavra chave",
 *         "images": []
 *       },
 *       {
 *         "_id": "56925f1b621d201be828880f",
 *         "slug": "titulo-2",
 *         "title": "Título 2",
 *         "shortDescription": "Breve descrição da Notícia",
 *         "description": "Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been...",
 *         "createdAt": "2012-04-23T18:25:43.511Z",
 *         "updatedAt": "2016-01-11T21:55:50.100Z",
 *         "keyWords": "palavra chave",
 *         "images": []
 *       }
 *     ],
 *     "total": 20,
 *     "limit": 2,
 *     "page": 1,
 *     "pages": 10
 *     "search": "pesquisar",
 *     "orderBy": "title",
 *     "orderDirection": "asc"
 *   }
 *
 * @apiErrorExample {json} Error-400:
 *     HTTP/1.1 400 Bad Request
 *    {
 *      "message": "Params validation error",
 *      "name": "RequestError",
 *      "errors": [
 *        {
 *          "param": "limit",
 *          "msg": "Parâmetro limit inválido",
 *          "value": "xyz"
 *        }
 *      ]
 *    }
 */
router.get('/', function(req, res, next) {
  // TODO: implements 403 Forbidden

  // validate params from query
  req.checkQuery('page', 'Parâmetro page inválido').optional().isInt({min: 1});
  req.checkQuery('limit', 'Parâmetro limit inválido').optional().isInt({min: 1});
  req.checkQuery('orderBy', 'Parâmetro orderBy inválido. Valores permitidos createdAt ou title').optional().isIn(['createdAt', 'title']);
  req.checkQuery('orderDirection', 'Parâmetro orderDirection inválido. Valores permitidos asc ou desc').optional().isIn(['asc', 'desc']);
  var errors = req.validationErrors();
  if (errors) {
    return res.status(400).json({
      message: 'Params validation error',
      name: "RequestError",
      errors: errors
    });
  }
  // process params from query and default values
  var search = req.query.search || '';
  var page = parseInt(req.query.page || 1);
  var limit = parseInt(req.query.limit || 10);
  var orderBy = req.query.orderBy || 'createdAt';
  var orderDirection = req.query.orderDirection || 'desc';
  // select query
  var query = {
    title: new RegExp(search, "i")
  };
  // pagination options
  var options = {
    page: page,
    limit: limit,
    sort:{}
  };
  options.sort[orderBy] = (orderDirection === 'desc') ? -1 : 1;
  // find docs
  NewsModel.paginate(query, options, function (err, result) {
    if (err) return res.status(400).json(err);
    if (result === null) return res.status(404).end();
    // including parameters in response
    result.search = search;
    result.orderBy = orderBy;
    result.orderDirection = orderDirection;
    return res.json(result);
  });
});

/**
 * @api {GET} /news/:id Recuperar
 *
 * @apiName Recuperar
 * @apiGroup News
 * @apiDescription Recupera uma notícia por id ou slug.
 * @apiPermission admin
 *
 * @apiHeader {String} x-access-token Token de acesso obitido no login.
 *
 * @apiParam {String} id O recurso pode ser obtido pela identificação do campo <code>_id</code> ou <code>slug</code>.
 *
 * @apiSuccessExample {json} Success-Reponse:
 *   HTTP/1.1 200 OK
 *   {
 *     "_id": "56925f1b621d201be828880e",
 *     "slug": "titulo-da-noticia",
 *     "title": "Título da notícia",
 *     "shortDescription": "Breve descrição da Notícia",
 *     "description": "Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been...",
 *     "createdAt": "2016-01-10T22:11:54.157Z",
 *     "updatedAt": "2016-01-11T21:55:50.100Z",
 *     "keyWords": "palavra chave",
 *     "images": [
 *       {
 *         "id": "5696918b4b7fe47125fe0433",
 *         "description": "Descrição da imagem 1",
 *         "url": "/images/news/56953c0f7bcf33389559630f/teste1.png",
 *         "index": 1
 *       },
 *       {
 *         "id": "5696918b4b7fe47125fe0434",
 *         "description": "Descrição da imagem 2",
 *         "url": "/images/news/56953c0f7bcf33389559630f/teste2.png",
 *         "index": 2
 *       }
 *     ]
 *   }
 *
 * @apiErrorExample {json} Error-404:
 *     HTTP/1.1 404 Not Found
 */
router.get('/:id', function(req, res, next) {
  // TODO: implements 403 Forbidden

  var id = req.params.id;
  // search by _id or slug
  var query = {$or: [{slug: id}]};
  if (id.match(/^[0-9a-fA-F]{24}$/)) {
    query.$or.push({_id: id});
  }
  NewsModel.findOne(query, function (err, result) {
    if (err) return res.status(400).json(err);
    if (result === null) return res.status(404).end();
    return res.json(result);
  });
});

/**
 * @api {POST} /news Criar
 *
 * @apiName Criar
 * @apiGroup News
 * @apiDescription Criar uma nova notícia.
 * @apiPermission admin
 *
 * @apiHeader {String} x-access-token Token de acesso obitido no login.
 *
 * @apiParam {string{1..255}} title Título da notícia. O slug será gerado a partir deste texto.
 * @apiParam {string{1..255}} shortDescription Breve descrição.
 * @apiParam {string} description Descrição completa. Texto puro ou HTML. Não há limite específico de caracteres, porém o campo não deve ultrapassar 16MB.
 * @apiParam {string{1..255}} [keyWords] Palavras chave separadas por espaço.
 *
 * @apiParamExample {json} Request-Body-Example:
 *   {
 *     "title": "Título da notícia",
 *     "shortDescription": "Breve descrição da Notícia",
 *     "description": "Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been...",
 *     "keyWords": "palavra chave"
 *   }
 *
 * @apiSuccessExample {json} Success-201-Reponse:
 *   HTTP/1.1 201 OK
 *   {
 *     "message": "Registro alterado com sucesso",
 *     "doc": {
 *       "_id": "56925f1b621d201be828880e",
 *       "slug": "titulo-da-noticia",
 *       "title": "Título da notícia",
 *       "shortDescription": "Breve descrição da Notícia",
 *       "description": "Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been...",
 *       "createdAt": "2016-01-10T22:11:54.157Z",
 *       "updatedAt": "2016-01-10T22:11:54.157Z",
 *       "keyWords": "palavra chave",
 *       "images": []
 *     }
 *   }
 *
 * @apiErrorExample {json} Error-400:
 *   HTTP/1.1 400 Bad Request
 *   {
 *     "message": "news validation failed",
 *     "name": "ValidationError",
 *     "errors": {
 *       "title": {
 *         "properties": {
 *           "type": "required",
 *           "message": "Path `{PATH}` is required.",
 *           "path": "title",
 *           "value": ""
 *         },
 *         "message": "Path `title` is required.",
 *         "name": "ValidatorError",
 *         "kind": "required",
 *         "path": "title",
 *         "value": ""
 *       }
 *     }
 *   }
 */
router.post('/', function(req, res, next) {
  // TODO: implements 403 Forbidden

  // model fill
  var data = new NewsModel({
    title: req.body.title,
    shortDescription: req.body.shortDescription,
    description: req.body.description,
    keyWords: req.body.keyWords || ''
  });
  // save doc
  data.save(function(err, result) {
    if (err) return res.status(400).json(err);
    return res.status(201).json({
      message: 'Novo registro criado com sucesso',
      doc: result
    });
  });
});

