/**
 * @api {DELETE} /news/:id Excluir
 *
 * @apiName Excluir
 * @apiGroup News
 * @apiDescription Remover uma notícia.
 * @apiPermission admin
 *
 * @apiHeader {String} x-access-token Token de acesso obitido no login.
 *
 * @apiParam {String} id ObjectId presente no campo <code>_id</code> do documento a ser excluido.
 *
 * @apiSuccessExample {json} Success-Reponse:
 *   HTTP/1.1 200 OK
 *   {
 *     "message": "Registro excluido com sucesso"
 *   }
 *
 * @apiErrorExample {json} Error-400:
 *   HTTP/1.1 400 Bad Request
 *   {
 *     "message": "Params validation error",
 *     "name": "RequestError",
 *     "errors": [
 *       {
 *         "param": "id",
 *         "msg": "Parâmetro id inválido",
 *         "value": "abcdef"
 *       }
 *     ]
 *   }
 *
 * @apiErrorExample {json} Error-404:
 *   HTTP/1.1 404 Not Found
 *   {
 *     "message": "Registro não existe"
 *   }
 */
 router.delete('/:id', function(req, res, next) {
   // TODO: implements 403 Forbidden
   // validate params from uri
   req.checkParams('id', 'Parâmetro id inválido').isMongoId();
   var errors = req.validationErrors();
   if (errors) {
     return res.status(400).json({
       message: 'Params validation error',
       name: "RequestError",
       errors: errors
     });
   }
   var id = req.params.id;
   NewsModel.findOne({_id: id}, function (err, doc) {
     if(err) return next(err);
     if (doc === null) return res.status(404).json({
       message: "Registro não existe"
     });
     // remove doc
     doc.remove(function (err, result) {
       if (err) return res.status(400).json(err);
       return res.json({
         message: 'Registro removido com sucesso'
       });
     });
   });
 });

